import React from 'react';
import styles from './style.module.css';
import Foto from './img/Foto.png';  
import Log from './img/log.png'; 
import alumnoSeleccionado from '../App'; 

function Targeta() {
 
  return (
    <div className={styles.contenedor }>
    
<section className={styles.tarjeta} id="tarjeta">
<div className={styles.delantera}>
  <div className={styles.logo} id="logo">
    <img src={Log} alt="" />
  </div>
  <img src={Foto} className={styles.chip} alt="" />
  <div className={styles.logo} id="logo">
    <div className={styles.grupo} id="numero">
      <p className={styles.label}>No.Control</p>
      <p className={styles.numero} name="apellido" >0000000000</p>
    </div>
    <div className={styles.flexbox}>
      <div className={styles.grupo} id="nombre">
        <p className={styles.label}>Nombre Estudiante</p>
        <p className={styles.numero} name="apellido" value={alumnoSeleccionado && alumnoSeleccionado.apellido}>$apellido</p>
      </div>
      <div className={styles.grupo} id="carrera">
        <p className={styles.label}>Carrera</p>
        <p className={styles.numero}>Nombre de la carrera</p>
      </div>
    </div>
  </div>
</div>
</section>
</div>


  );
};


export default Targeta;
